import React, { Component } from 'react'

class CommmentList extends Component {
  renderComments() {
    return this.props.comments.map((comment, index) => {
      return <li key={index}>{comment}</li>
    })
  }

  render() {
    return (
      <div>
        <ul>{this.renderComments()}</ul>
      </div>
    )
  }
}

export default CommmentList
